import React from 'react'
import './Board.css'
export default function Board(props) {
    let board =[];
    let height = props.data.length
    for (let i=0; i<height; i++){
        board.push([])
        let width = props.data[i].length
        for (let j=0; j<width; j++){
            var letter = props.data[i][j]
            if(letter === 0){
                board[i].push(<div className='emptySquare' id={`${i},${j}_play`}></div>)
            } else if ( letter === 1){
                board[i].push(<div className='rockSquare' id={`${i},${j}_play`}></div>)
            } else{
                board[i].push(<div className='letterSquare' id={`${i},${j}`}>{letter}</div>)
            }
            // board[i].push(<div>{letter}</div>)
        }
    };
  return (
    <div>{board.map((row)=>(
        <div className='row'>
        {row.map((letter)=>(
            <div>{letter}</div>
        ))}
        </div>
    ))}</div>
  )
}
